import { TextField } from '@material-ui/core';

export const SignUp = () => {
	return (
		<div>
			<p>Signup page</p>
			<TextField required id='standard-required' label='Required' />
			<TextField
				id='outlined-password-input'
				label='Password'
				type='password'
				autoComplete='current-password'
				variant='outlined'
			/>
		</div>
	);
};
